import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css';

const Dashboard = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate('/login');
  };

  return (
    <div className="dashboard-container">
      <h2>Welcome to Dashboard</h2>
      <div className="buttons-container">
        <button className="color-button red">Red Button</button>
        <button className="color-button blue">Blue Button</button>
        <button className="color-button green">Green Button</button>
        <button className="color-button purple">Purple Button</button>
        <button className="color-button orange">Orange Button</button>
      </div>
      <button className="logout-button" onClick={handleLogout}>
        Logout
      </button>
    </div>
  );
};

export default Dashboard;
